def is_coprime(a, b):
    for i in range(2, min(a, b) + 1):
        if a % i == 0 and b % i == 0:
            return False
    return True

l, r = map(int, input().split())

for a in range(l, r):
    for b in range(a + 1, r):
        if is_coprime(a, b):
            for c in range(b + 1, r + 1):
                if is_coprime(b, c) and not is_coprime(a, c):
                    print(a, b, c)

